import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import LoginImg from "../assets/login.jpg";
import Footer from "../components/Footer";

function Login () {
    return (
        <>
            <Navbar />
            <Hero
                cName="hero-mid"
                heroImg={LoginImg}
                title="Welcome"
                btnClass="hide"
            />

            <Footer />
            </>
    )
}

export default Login;
